import React from 'react';
import img from '../logo.svg';
import {Link} from 'react-router-dom';


export default function Navbar() {
    return (
        <NavWrapper className="navbar navbar-expand-sm navbar-darkpx-sm-5">
            <ul>
            <li>
            <Link to='/' className="navbar-nav align-items-center">
               Home 
            </Link>
            </li>
            <li>
            <Link to='/Menu' className="navbar-nav align-items-center">
               Menu
            </Link>
            </li>
            </ul>
        </NavWrapper>
    )
}
